    "reviewContent": "Allosaurus are the most common Mesozoic theropod dinosaurs.To estimate the size of the bone at different ages Lines of Arrested Growth (LAGs) is used.Lines of Arrested Growth are actually seasonal. Dinosaurs grew less in winter season. Allosaurus is the first animal to exhibit two major growth spurts in its life. It appears to have a second growth spurt later in life. Previous studies of bone growth of large dinosaurs reported slow growth patterns after first growth spurt.",
