    "reviewContent": "The work on Allosaurus bone growth is interesting in that it is the only animal to have a late adult growth spurt.  More investigation into whether or not this is the case needs to be done.  If it turns out that Allosaurus does have have a late life growth spurt across the species, then there should be research done to understand why this would be and if any other species show this growth spurt.",
