    "reviewContent": "Although this is an interesting hypothesis, I do not see any solid proof that the Allosaurus had 2 main growth spurts.  The age offsets seem to be randomly placed to make a more visually appealing chart, rather than off of hard science.  Moving the age offsets around, could show that there is only 1 growth spurt, or many different growth spurts. The article will need more evidence to prove that the age offset is reliable and not just arbitrary numbers to make the hypothesis seem correct. ",
