    "identifiedConclusion": true,
    "reviewContent": "This work is very compelling, but I paused when I saw that conclusions were drawn from bones from six seemingly unique dinosaurs.  From that data, you could just as easily draw the conclusion that Allosaurs only have one growth spurt but that it happens at different ages for different dinosaurs.  Looking at Femur 1, growth really seems to flat line from about ages 8-12 and there is no indication that the dinosaur that Femur 1 belongs to will have a 2nd growth spurt.",
