    "id": 57,
    "mode": 0,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "Would the conclusion be the same if bones were collected from a different location, for the same species, perhaps with a harsher climate that limited growth potential (i.e., worse diet)?\n\nCollecting all the bones from the same location doesn’t necessarily extend globally to all dinosaurs.  \n\nIn their defense, they did conclude: “…We cannot directly reject or support the hypothesis of unlimited growth in Allosaurus in the situation where this repeated growth spurt continued to cycle throughout the duration of their lives.”  \n\nThis is a fair statement and, as such, I think the article is good and provide food for thought and reason to question previous conclusions.",
