    "reviewContent": "I'm having a problem understanding  the comparison between Arrested growth lines and rings of a tree, in order to tell age. There is not enough information in this article to make that conclusion. It also seems that you created an equation so the data would fit your hypothesis. I don't really see any evidence that supports your clam. There is also the possibility that none of the fossils are from full grown Allosaurus. So stating that the Allosaurus experiences unlimited growth is impossible to determine from the information in this article. I think that there needs to be more information on how you determined the age of the Allosaurus, based on the circumference of its bone. I also think that your understanding of LAGS might be incorrect.",
