    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "Firstly, I am concerned about the sample size being used. Surely examining 6 bones from 2 sites is insufficient to draw and meaningful conclusions about Allosaurus bone growth. Secondly, I am skeptical of any scientific method that involves using \"Excel spreadsheet to increase or decrease the age offset until the bone-growth curves visually align to one another.\" This seems to be a manipulation of the data rather than an examination of it. Lastly, graph appears to show that growth spurts can occur earlier or later in life, not that the Allosaurus experiences two. Each femur examined appear to have only one period of rapid growth and then flatlines. This growth however can occur later in life.",
