    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "The authors seem to assume that differences in measurements are due solely to age. The age offset is an arbitrary modifier applied to make the data look contiguous. It also seems to hide the fact that the DPP femurs were consistently larger than the CDLQ femurs. An equally plausible conclusion is that Allosaurus in Canada were simply larger than Allosaurus in Utah. The authors do nothing to address this argument.",
