    "reviewContent": "While the bones selected were all Allosaurus bones, the authors introduce an unnecessary variance by using samples from two different locations.  This introduces further complications with the method used to approximate age, LAG, because growth will vary in the two different locations.  This is further indicated by the fact that the \"youngest\" bones all came from the Utah location, and the \"oldest\" bones came from the Canadian location.",
