    "reviewContent": "The age offsets seems an odd choice. Data doesn't neccessarily need to visually line up as one can infer best fit lines to show how the data matches out. And this may be the reason why two growth stages appear - that is, the age offest is causing the second growth stage to appear. If you eliminate the age offest, each dinosaur only shows one growth stage. Since these allosaurus' come from different areas, perhaps they were different species or varieties with one that grows larger than the other, similar to dogs today. ",
