    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "The sample size is way too small to make sweeping conclusions. I wouldn't trust anything under 30 different specimens, and even that is considered a small sample in statistical circles. Only by analyzing as many bones as possible can we come anywhere near a truthful and accurate measurement. This is a good start, but needs a much larger sample size to confirm.",
