    "id": 176,
    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "I think that this article represents an interesting approach to determining the ages of dinosaurs based on their bones. I have concerns, however, about two assumptions that may represent logical leaps for this research. One assumption is that “dinosaurs grew less in the winter.” The article asserts that this is based on previous research, but how reliable and accepted is that research? A second assumption follows immediately after the first: “Thus, each LAG can be assumed to represent one year of growth.” I am concerned that we are taking this accepted fact from trees and applying it to animals without sufficient scientific warrant. And these two assumptions undergird the entire scientific process in this article. If either or both of these assumptions turn out to be incorrect, than that contaminates the conclusions that the author reaches.",
