    "id": 326,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "\"We use an Excel spreadsheet to increase or decrease the age offset until the bone-growth curves visually align to one another.\" This sounds highly subjective. As though you are assuming that all the bones will have the same growth pattern throughout their life, which does not take into account varying conditions over the course of their life or their genetic make up. This seems like circular reasoning. This bone is this age because it is this size, making that bone this age based off of this size. You don't state how you come to age the dinosaurs except by measuring them against each other. This is like saying a well fed three year old african american boy is the same size as a poorly fed three year old oriental girl both of whom could be living in the same neighborhood. You are missing any bones that actually span the time frame you want to evaluate, from eight to fifteen. The one bone that does have a few of these combined years, actually does not show a major increase in size for a second growth spurt. ",
