    "id": 193,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "A sample size of 6 seems fairly small. Also, the authors say the bones were from two locations but do not say how many came from each. It is possible that location is a factor that needs to be considered in the calculations. The fact that the authors point out that the weather has an affect on bone growth makes careful documentation of the origin of the bone samples that much more important. Additionally, the authors do not seem to account for male / female populations; what sex were each of the samples and does that affect the growth of the bone?",
