    "reviewContent": "I think the Paper is very well thought of and very informative. The study itself was well thought of and planned. You can tell that  a very long amount of time was put into this study. I like how your findings where made clear and easy to understand. I also liked how you explained your reasoning for using the bones that you did and why it made sense. You did not jump to conclusions either, by saying that the study proves that Allosaurus have unlimited growth, but instead you presented it as another hypothesis. In conclusion, I think this is a wonderful paper and you did a great job.",
