    "id": 368,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "The main conclusion of \" the Allosaurus has multiple major growth spurts throughout life\" in incorrect. Almost all femurs presented had a plateau in growth after the initial timepoints and the data represented is all sic femurs individually, not a three femurs with different growth phases . In addition, basing growth of LAG is correct, but looking at femurs from different geographical locations does not account for climate and weather, which apparently influences LAG as growth slows during winter. Finally, the authors did not provide evidence that the femurs were all actually from the same species of Allosaurus which is required for direct comparison of femur growth. ",
