    "id": 222,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "I think it would be beneficial to provide more detail on how the \"age offset\" was calculated. As it's a little confusing to figure out how they came to the conclusion that the age offset was 10 years vs. let's say 2 years. Was this an increase in bone circumference. How do we know that this was an increase in age and not a huge spurt in bone growth within the first year. This area of the study needs to have more explanation on how they acquired the \"age offset\" data. \n\nAlso a more detailed explanation on how to utilize the chart should be included with the study. So that people who are not knowledgeable on how these charts work could have a better understanding of what the chart shows. \n\nScientific study should include images of what is being talked about. Graphic images help the reader understand better what is being explained.\n\n",
