    "feedback": "Very interesting study. I have heard recently someone tell me that dinasours may have not existed and i thought that they were wrong. This proves they were not wrong. The study if correct shows a spurt at 10 years old which is similar to the human spurt at 10 when a child goes through puberty. There are rumors in the alt. media that human possibly have reptile DNA and even the medical system acknowledges the \"reptilian\" part of the brain in medical diagrams. \nAnother interesting thing is that there are rumors from govt insiders that a reptilian/human hybrid species may be still on our planet in underground caverns. And the Native Americans and African shamans agree that there is another species here. The youtube video \"Jordan Maxwell interview with Nancy about her Reptilian encounter\" is interesting and exposes that this reptilian evolved creature may be on our planet. And there have been news articles with encounters. So this topic is interesting to me.  ",
