    "reviewContent": "I have a few questions. How come the difference couldn't simply be the difference in the two sites? Couldn't the dinosaurs in Alberta Canada just grow at a different rate from the other dinosaurs based on the nutrients available? That is, couldn't Utah Allosaurus's be done growing at age 10-14, and the Alberta dinosaurs are done growing at age 14-18. It could be that nutrients are needed for a dinosaur to reach its full size, and once it reaches that size, it does not grow more. It make take longer to get those nutrients in Canada. Please add a paragraph explaining why this explanation does not make sense. ",
