    "reviewContent": "Is a sample size of six sufficient to draw any conclusions?  I don't understand the rationale for the \"age offsets\".  Without the offsets, growth does appear to slow/level off over time for all dinosaurs.  Even with the offsets, only a few dinosaurs exhibit the second growth spurt.  A larger sample size and more explanation for the use of offsets is needed.",
