    "id": 255,
    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "This study appears to show that the Allosaurus experienced multiple growth spurts during its life as opposed to the more common experience of a singular growth period of other dinosaurs.  This group measured the Lines of Arrested Growth (LAN) in large femur bones to track growth in a similar manner that scientists use tree rings to track their growth.  This study suggests that one reason dinosaurs grew so large in comparison to other birds or reptiles was due to these repeated growth spurts.",
