    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "The conclusion that dinosaurs have two growth spurts is difficult to conclude from the data. There is no good reasoning in the paper as to how the offset choice is made. An alternative explanation can be made that there is a single growth spurt, and that dinosaurs from different sites had overall differences in sizes. \n\nWith that being said, I believe the authors should consider exploring the change in growth over time, since this seems consistent between the two sites.",
