    "id": 263,
    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "When it comes to the strenghts of this paper, the statement regarding your findings before the daate presentation is very strong and really provides a great backbone for the entire paper.  The conclusion does a great job of expanding your findings into other hypothesis, and offering room for other research and scientific studies to be done.  The second interactive graph was very interesting how you used sliders which gave the readers the tools to move the graph objects.  My most favorite part about the study was how you explained very complicated dinosaur and experiment terms with great analogies.  For example, explaining the method of finding the places to measure the bone circumfrence, referencing the ring of the trees was quite genious.  Overall, this paper wa very well organized, comprehensible, and this made the authors very credible with their research.",
