    "reviewContent": "In the initial paragraph, there's an awkward switch from plural to singular that made me feel like I skipped a sentence. There are several places where 'previous work' is mentioned, but no source is given. In order to give strength to the argument, previous work that it is based upon should be cited.\n\nWith that said, I think there's something to the study here. I'm not completely convinced, however, and would like to see it repeated with a larger selection of bones. One reason I say this is that there is an age offset that is being done to make bones that have fewer visible LAGs (but are bigger bones) match up with the other bones that are smaller, and get a better idea of the age. I think this could be a reasonable approach, but it doesn't account for (as an example) a genetic abnormality like gigantism that could lead to bigger bones in some of the samples. I feel as if the offset is sort of unscientific, in its nature, because it's being done by visually inspecting the curve. I would prefer it be based upon a custom formula for normalizing the data, or even better, something that is citeable as an industry standard way to normalize it. A bigger sample would make it easier to see if there was reason to question that method or not, though. ",
