    "id": 13,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "There are a few holes in the conclusion of having multiple growth spurts. One major issue I see are the bones locations. Femur 1 2 3 were all in one site, and femur 4 5 6 were in another separate site. Canadian Allosaurs could be bigger in general than American Allosaurs, assuming there is a direct correlation between femur circumference and age, which is also not conclusive. Treating these femurs as one dinosaur does not make sense. Perhaps species size depends on location. If might also be possible these are two different sexes, male and female here. The second growth spurt disappears when all offset's for age are taken away. Also, pterodactyls may have picked these bones up and flew them between the sites, creating more chance for LAG and offset error.  ",
