    "reviewContent": "I found this article very hard to read.  I would have preferred pictures as well as the graphs.  In one paragraph the author states and I quote \"These measurements and estimates lead us to a novel conclusion: the Allosaurus is the first animal to exhibit two major growth spurts in its life.\"  Yet in another paragraph, the author states and I quote, \"In contradiction, we conclude that Allosaurus had multiple major growth spurts throughout life.\"  This begs to differ, do Allosaurus have two major growth spurts or multiple major growth spurts?  This article needs to be researched in greater depth.",
