    "reviewContent": "My first thought reading this was what ages were the dinasours that were being tested?\nAs far as the conclusion that allosaurus was the first dinasour tested to have two major growth spurts it seemed to make me question a bit why there was not any mention of the study's on the other dinasours and their growth patterns. \nI loved the graph and felt that it was easy to read and understand.\nI was also curious why there was a growth spurt so early in life.. the toddler years (2,3,4 and then 10,10,12) or if I was not understanding that correctly. If I wasn't understanding it correctly maybe it could be put into laymans terms. \nSince the observation was that dinasours grew less in winter it made me curious as to why? Could you possibly include what your reasoning is?",
