    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "Studying the bones of the Allosaurus to discover growth patterns seems like a valid way to proceed. However, the experiment only used Allosaurus bones that they found in a few distinct regions. What the researchers failed to account for is that there may be Allosaurus bones from other regions with different measurements. If they searched for other locations they may have been able to compare different growth patterns. The results as is, are fine but they can not be used on a larger scale.",
