    "id": 117,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "I can't really see how you draw your conclusions based on the data you collected. The growth by age as measured by circumference doesn't appear to have multiple growth spurts at all by raw numbers alone, let alone two growth spurts. Beyond that you give no measures of how you came up with your age offset, and it seems like an underhand way to generate a growth curve that supports your claims rather than a factual process. If you had hard formulas and gave more logic behind your generation of the age offsets, it would lend a lot of validity to your claim. Also the fact that the first sample doesn't see the start of the second growth spurt despite being 12+ years of age is slightly suspect.",
