    "id": 399,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "The age offset is a huge leap of faith here and whilst it works to manipulate the data to provide the second growth spurt it doesn't hold up as evidence. The red line of femur 1 shows the flattening off at maturity with no further growth spurt. The additional older bone sample show growth spurt which occur years before that flattening off so this would appear to disprove the theory. In addition, there is no evidence that those older samples were not just evidence of a continual growth patterns up to age 18 in these dinosaurs rather than a second growth spurt. Without evidence of their younger sizes, it can not be concluded that this is a second growth spurt as you could just as easily draw a curve from youth to those current levels and it would be equally accurate.",
