    "reviewContent": "The graphical offset method could conceptually work, but I would like to see much more data with different bones before I used such a novel approach.  With the difference in circumference being about 4\" to 9\", there could be much overlap in same age dinosaurs with varying sizes.  Presuming that an Allosaurus that was 4 years old could not have an 180mm circumference femur could be dead wrong, with no enough data to see that same year variation.  ",
