    "identifiedConclusion": false,
    "reviewContent": "I think the work is well presented and includes some very interesting ideas. The idea of a second growth spurt in the Allosaurus is intriguing, and the evidence presented seems to suggest it. However, I think it would be more convincing if the data was more varied -- if we had more points of data for each animal, as is presented with femur one. To really prove the hypothesis, I'd think all of the femurs should have comparable points of data to more accurately compare the bones at more points in time, over the same duration of life. ",
